  return (
    <div className="">
      <Tabs
    defaultActiveKey="first"
    transition={false}
    id="noanim-tab-example"
    className="">
  <Tab eventKey="first" title="Categories">
  <button className='plusBtn btn btn-primary me-md-2'><i className="fa fa-plus"></i></button>
    < CategoriesTable/>
  </Tab>
  <Tab eventKey="second" title="Books">
    {/* <Sonnet /> */}
  </Tab>
  <Tab eventKey="third" title="Authors" >
    {/* <Sonnet /> */}
  </Tab>
</Tabs>
    </div>
  );
}

export default ThreeTabs;
